import React from 'react';

function Home(){
    return(
        <div className='home-container'>
            <div className="sideBar-container">
                <span className="sideBar">
                    <a href="#">
                        <div className="my-active"><i className="fa-solid fa-house"></i> Home</div>
                    </a>

                </span>
            </div>
        </div>
    );
}

export default Home;
